import React, { useEffect } from 'react';

const CompModal = () => {
  useEffect(() => {
    let modal = document.querySelector('.modal')
    setTimeout(()=>{
      modal.classList.add(`active`)

    },1)
  }, [])//태어났을때 딱 한번(새로고침)
  return (
    <div className='modal'>
      <p>게임끝!</p>
      <button>초기화</button>

    </div>
  );
};

export default CompModal;
